/* 抽奖结果 */
function draw_Result(index) {
    _ajax('GET', getResult, '', function(data) {
        console.log(data);
        if(data.success == true){
            result.style.display = 'block';
                box_border[index].style.opacity = 0;
                vibrateEffect(result);
                _index = index;
            var data1 = JSON.parse(data.data);
            var check = 0;
            if (data1.success == true) { //请求成功
                var msg = data1.msg;   
                var usefull_Msg = ''; //奖品等级
                var usefull_Url = ''; //奖品图片链接
                if (msg.indexOf("本次没有中奖") != -1) {
                    check = 1;
                    console.log(check);
                    setTimeout(function() {
                        Afer_draw(check)
                    }, 1000);
                } else if (msg.indexOf('你的抽奖次数已经用完') != -1) {
                    check = 2;
                    setTimeout(function() {
                        Afer_draw(check, msg)
                    }, 0);
                } else {
                    serialId = data1.data.serialId;
                    usefull_Msg = msg.replace('恭喜中奖,获得奖品是：', '');
                    console.log(usefull_Msg);
                    for (var i = 0; i < database.length; i++) {
                        if (database[i].rewardName == usefull_Msg) {
                            usefull_Url = database[i].rewardImg;
                        }
                    }
                    setTimeout(function() {
                        Afer_draw(check, usefull_Msg, usefull_Url)
                    }, 1000);
                }
            } else { //请求失败
                check = 1;
                setTimeout(function(){Afer_draw(check)}, 2000);
            }
        }else{
            _toast("网络故障，请重试！", 2000 , 2, function (){
                error.style.display = 'block'; 
            });
        }    
    })
}

