/*提交填写的联系方式*/
function submit_Contact() {
    var check_value = true; //true 说明内容都填写了， false内容填写不完整
    var is_phone = false; //是否有手机号验证
    var phone_index = null; //手机号input的索引
    /*首先验证input不能为空*/
    for (var i = 0; i < contact_Input.length; i++) {
        if (contact_Input[i].value == '') {
            _toast("填写信息不完整", 2000 , 2, function(){});
            check_value = false;
            break;
        } else {
            check_value = true;
        }
        if (contact_Input[i].name == '手机号') {
            phone_index = i;
            is_phone = true;
        }
    }
    /*检测是否有手机验证的收奖方式*/
    if (is_phone == true && check_value == true) {
        console.log('you');
        var x = contact_Input[phone_index].value;
        var y = contact_Input[phone_index + 1].value;
        /*校验-验证码和手机号是否正确*/
        if (re.test(x)) {
            check_Verify_Code(x, y);
            // draw_after_page.style.cssText += 'background:url('+ _url +');background-size: contain;background-repeat: no-repeat;';
            draw_after_page_3.removeEventListener('click', _btn, false); //去掉btn上的事件
            draw_after_page_3.addEventListener('click', back2ActiveList, false);
        } else {
            _toast("输入手机号码不正确！", 2000 , 2, function(){});
        }
    } else if (is_phone == false && check_value == true) {
        console.log('meiyou');
        upload_Data();
        //draw_after_page.style.cssText += 'background:url('+ _url +');background-size: contain;background-repeat: no-repeat;';
        draw_after_page_3.removeEventListener('click', _btn, false); //去掉btn上的事件
        draw_after_page_3.addEventListener('click', back2ActiveList, false);
    }
}

