function vibrateEffect(obj) {
    obj.style.display = "block";
    obj.style.animation = "vibrateLoop 500ms";
    obj.style.webkitAnimation = "vibrateLoop 500ms";
    obj.style.animationIterationCount = "infinite";
    obj.style.webkitAnimationIterationCount = "infinite";
    obj.style.animationTimingFunction = "linear";
    obj.style.webkitAnimationTimingFunction = "linear";
}

//停止振动特效函数
function stopVibrateEffect(obj) {
    obj.style.animation = "none";
    obj.style.webkitAnimation = "none";
}

function _GetUrlParams() {
    var url = location.search; //获取url中"?"符后的字串
    var theRequest = {};
    if (url.indexOf("?") != -1) {
        var str = url.substr(1);
        var strs = str.split("&");
        for (var i = 0; i < strs.length; i++) {
            theRequest[strs[i].split("=")[0]] = unescape(strs[i].split("=")[1]);
        }
    }
    return theRequest;
}

function checkOS() {
    var ua = navigator.userAgent.toLowerCase();
    if (ua.indexOf('mac') != -1) {
        return 1;
    } else {
        return 2;
    }
}

function _checkApiUrl(_apiServer) {
    _apiServer = _apiServer.toLowerCase();
    if (_apiServer.indexOf('http') == -1) {
        return 'http://' + _apiServer;
    } else {
        return _apiServer;
    }
}

