function setupWebViewJavascriptBridge(callback) {
    if (window.WebViewJavascriptBridge) {
        return callback(WebViewJavascriptBridge);
    }
    if (window.WVJBCallbacks) {
        return window.WVJBCallbacks.push(callback);
    }
    window.WVJBCallbacks = [callback];
    var WVJBIframe = document.createElement('iframe');
    WVJBIframe.style.display = 'none';
    WVJBIframe.src = 'wvjbscheme://__BRIDGE_LOADED__';
    document.documentElement.appendChild(WVJBIframe);
    setTimeout(function() {
        document.documentElement.removeChild(WVJBIframe)
    }, 0)
}

function _toast(msg, _time, _type, fun) {
    loadingEle.style.display = "none";
    _time = _time || 3000;
    _type = _type || 1;
    toastIcon.className = _type == 1 ? 'weui_icon_toast' : 'weui_icon_toast_err';
    toastContent.innerHTML = msg;
    toastEle.style.display = "block";
    setTimeout(function() {
        toastEle.style.display = 'none';
        fun();
    }, _time);
}

function _displayLoading(_type, msg) {
    _type = _type || 0;
    msg = msg || "视频加载中";
    loadingToastContent.innerText = msg;
    if (_type == 0) {
        setTimeout(function() {
            loadingEle.style.display = "none";
        }, 1500);
    } else {
        loadingEle.style.display = "block";
    }
}


/*ajax函数*/
function _ajax(type, url, param, callback) {
    if (typeof param == "undefined" && typeof callback == "undefined") {
        param = {};
        callback = null;
    } else if (typeof callback == "undefined") {
        if (typeof param == "function") {
            callback = param;
            param = {};
        } else {
            param = param || {};
            callback = null;
        }
    } else if (typeof param == "undefined") {
        if (typeof callback == "function") {
            param = {};
        } else {
            param = callback || {};
            callback = null;
        }
    } else {
        if (typeof param == "function") {
            param = {};
        } else {
            param = param || {};
        }

        if (typeof callback != "function") {
            callback = null;
        }
    }
    var paramStr = "";
    for (var p in param) {
        paramStr += p + "=" + param[p] + "&";
    }
    if (param.length > 0) {
        paramStr = paramStr.substr(0, paramStr.length - 1);
    }
    var _xmlhttp;
    if (window.XMLHttpRequest) {
        // code for IE7+, Firefox, Chrome, Opera, Safari
        _xmlhttp = new XMLHttpRequest();
    } else {
        // code for IE6, IE5
        _xmlhttp = new ActiveXObject("Microsoft.XMLHTTP");
    }
    _xmlhttp.onreadystatechange = function() {
        if (_xmlhttp.readyState == 4 && _xmlhttp.status == 200) {
            callback && callback({
                success: true,
                data: _xmlhttp.response || _xmlhttp.responseText,
                msg: "异步加载成功!",
                type: null,
                code: 200
            });
        } else {
            //console.log("异步加载ing _xmlhttp.status  :" + _xmlhttp.status + "  _xmlhttp.readyState  :" + _xmlhttp.readyState);
        }
    };
    // ajax处理请求超时
    _xmlhttp.ontimeout = function() {
        callback && callback({
            success: false,
            data: null,
            msg: "请求超时",
            type: null,
            code: 0
        });
    };
    //ajax 请求出错的时候
    _xmlhttp.onerror = function() {
        callback && callback({
            success: false,
            data: null,
            msg: "请求出错",
            type: null,
            code: 0
        });
    };
    //  处理 Get 或者Post
    if (type == "GET") {
        _xmlhttp.open("GET", url + paramStr, true);
        _xmlhttp.timeout = 3000;
        _xmlhttp.setRequestHeader('Content-Type', 'text/plain;charset=UTF-8');
        _xmlhttp.send();
    } else {
        _xmlhttp.open("POST", url, true);
        _xmlhttp.timeout = 3000;
        _xmlhttp.setRequestHeader('Content-Type', 'text/plain;charset=UTF-8');
        _xmlhttp.send(paramStr);
    }
}